import React, { Fragment } from 'react'
import {
  Container,
  Card,
  Form,
  FormLabel,
  Row,
  Col,
  Button,
  FormCheck,
  FormGroup,
  FormSelect,
  FormControl,
} from "react-bootstrap";
import Eventos from '../componentes/principal/Eventos';
const Studs = () => {
  return (
    <Container>
      <Row className="text-center">
        <h1>LISTADO DE STUDS</h1>
      </Row>
      <Eventos></Eventos>
    </Container>
  )
}

export default Studs
